import { Link, NavLink } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="bg-white shadow sticky top-0 z-50">
      <div className="container mx-auto flex items-center justify-between py-4 px-4">
        <Link to="/" className="flex items-center space-x-2">
          {/* Replace with your logo if available */}
          <span className="font-bold text-xl text-blue-700">Gajulapalli Infra</span>
        </Link>
        <ul className="hidden md:flex space-x-8 font-medium">
          <li><NavLink to="/" className={({isActive}) => isActive ? 'text-blue-600 font-bold' : 'hover:text-blue-600'}>Home</NavLink></li>
          <li><NavLink to="/about" className={({isActive}) => isActive ? 'text-blue-600 font-bold' : 'hover:text-blue-600'}>About</NavLink></li>
          <li><NavLink to="/services" className={({isActive}) => isActive ? 'text-blue-600 font-bold' : 'hover:text-blue-600'}>Services</NavLink></li>
          <li><NavLink to="/projects" className={({isActive}) => isActive ? 'text-blue-600 font-bold' : 'hover:text-blue-600'}>Projects</NavLink></li>
          <li><NavLink to="/contact" className={({isActive}) => isActive ? 'text-blue-600 font-bold' : 'hover:text-blue-600'}>Contact</NavLink></li>
        </ul>
        {/* Mobile menu button (not functional in this starter) */}
        <button className="md:hidden focus:outline-none">
          <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16M4 18h16"></path></svg>
        </button>
      </div>
    </nav>
  );
}

export default Navbar;
